    "summary": "An all-girls' robotics team in Afghanistan risks it all to prove that it can compete against anyone in the world, and demonstrates that girls can become scientists and engineers instead of teenage brides. Working in secret under Taliban rule, the high-school-aged team members struggle in the face of immense odds and ever present danger, and single-handedly begin to change perceptions in this entrenched Islamic culture. The film focuses on three team members - Fatemah, Somaya, and Lida - all of whom are fiercely determined to follow their passions and become role models for the next generation. Afghan Dreamers is a film that dares to ask if a better future is possible for women in a country like theirs.—DG",
