    "summary": "The Art of Un-War is an in-depth exploration of renowned artist Krzysztof Wodiczko's life and the art interventions he creates as powerful responses to the inequities and horrors of war and injustice. Throughout the film, the artist's powerful interventions become examples of how art can be used to disrupt public complacency. The evolution of Wodiczko's political art unfolds throughout the film from his first intervention created in Warsaw in 1968, to one of his most ambitious projects and a focal point of the film - a radical proposal to transform Paris' Arc De Triomphe war monument into a site for peace-building research and activism. Wodiczko counters the monument's glorification of war and portrayal of distorted histories by constructing scaffolding around the Arc De Triomphe and transforming it into its complete antithesis.—Maria Niro",
